import { Layout, Menu, Avatar } from "antd";
import React from "react";
import { UserOutlined } from "@ant-design/icons";

const { SubMenu } = Menu;
const { Sider } = Layout;

export default function Contacts({ userId }) {
  return (
    <Layout>
      <Sider width={200}>
        <Menu
          mode="inline"
          defaultSelectedKey={["1"]}
          defaultOpenKey={["contact1"]}
          style={{ height: "100%", borderRight: "1px" }}
        >
          <SubMenu key="contact1" icon={<UserOutlined />}>
            <Menu.Item key="1">user 1</Menu.Item>
          </SubMenu>
        </Menu>
      </Sider>
    </Layout>
  );
}
